import React from "react";

import { makeStyles, CssBaseline, Button, Avatar, Container, Typography } from '@material-ui/core';
import AccountCircleIcon from '@material-ui/icons/AccountCircle';
import { useHistory } from "react-router-dom";

import fire from "../fire";

const useStyles = makeStyles((theme) => ({
  avatar: {
    '&:hover':{
      backgroundColor: "grey",
      cursor: "pointer",
    },
    margin: theme.spacing(1),
    width:"100px",
    height:"100px",
  },
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
}))

function ProfilePage () {
  const classes = useStyles();
  const history = useHistory();

  const name = localStorage.getItem("name");
  const init = localStorage.getItem("initials")

  const onClick = () => {
    
  }

  return(
    <Container component="main" maxWidth="xs">
      <CssBaseline/>
      <div className={classes.paper}>
        <Avatar className={classes.avatar} src={init ? null : AccountCircleIcon}>
          <Button onClick={onClick}>
            {init}
          </Button>
        </Avatar>
        { name ? 
          <>
            <Typography component="h1" variant="h5">
              {name}
            </Typography>
            <Button className={classes.button} onClick={() => {
                      fire.auth().signOut()
                        .then((user) => {
                            localStorage.clear();
                            history.push("/login")
                        })
                        .catch((error) => {
                            console.log("An error occured ", error)
                        })
                  }
                }
            >
                Logout
            </Button> 
          </>
          :
          <Button className={classes.button} href="/login">
            Login
          </Button> 
        }
      </div>
    </Container>
  );
}

export default ProfilePage;
